name: pipeline-with-mocks
description: a full pipeline seeded with data from mock-observations feature
tags: null
initialize:
  plugins:
    mock-observations:
      path: '@grnsft/if-plugins'
      method: MockObservations
      global-config:
        timestamp-from: 2024-05-12T00:00
        timestamp-to: 2024-05-15T00:00
        duration: 60
        components:
          - cloud/instance-type: A1
        generators:
          common:
            cloud/region: switzerland-north
            common-key: common-val
          randint:
            cpu/energy:
              min: 1
              max: 250
            cpu/utilization:
              min: 1
              max: 99
    operational-carbon:
      path: '@grnsft/if-plugins'
      method: Multiply
      global-config:
        input-parameters:
          - grid/carbon-intensity
          - cpu/energy
        output-parameter: carbon
    json-exporter:
      path: '@greenguardians/json-exporter'
      method: JSONExporter
      global-config:
        output-path: ./data/exported.json
    swiss-grid-plugin:
      path: swiss-grid-plugin
      method: SwissGridPlugin
      global-config:
        keep-existing: true
  outputs:
    - yaml
if-version: v0.3.2
tree:
  children:
    child-1:
      pipeline:
        - mock-observations
        - operational-carbon
        - swiss-grid-plugin
        - json-exporter
      config:
        group-by:
          group:
            - cloud/region
            - instance-type
      defaults:
